import { Flex, Container, Box, Stack, Typography, Card, Divider, CardMedia, Grid } from "@mui/material";
import image from './images/image5.png';
import DevOps from './images/DevOps.png';
import { useSpring, animated, useScroll, useInView} from '@react-spring/web';

const commonCardStyle = {
  bgcolor: 'cyan',
  height: '300'
}

const MazeGameCard = (
    <Card sx={commonCardStyle}>
      <Typography sx={{ fontSize: 20 }} color="text.primary" gutterBottom>
        Maze Game
      </Typography>
      <Divider />
      <Box>
        <CardMedia
            component="img"
            alt="Project Image"
            src={image}
            style={{
              objectFit: "cover",
              width: "100%",
              height: "100%",
            }}
          />
      </Box>
    </Card>
);

const DevOpsCard = (
  <Card sx={commonCardStyle}>
    <Typography sx={{ fontSize: 20 }} color="text.primary" gutterBottom>
      Dev Ops
    </Typography>
    <Divider />
    <CardMedia
      component="img"
      alt="Project Image"
      src={DevOps}
      style={{
        objectFit: "cover",
        width: "100%",
        height: "100%",
      }}
    />
  </Card>
);

function Projects() {

    const [ref1, inView1] = useInView();
    const [ref2, inView2] = useInView();
    const [ref3, inView3] = useInView();

    const left2right = useSpring({
      from: { x: 0 },
      to: { x: inView1 ? window.innerWidth * 0.1 : 0 },
    });
    const right2left = useSpring({
      from: { x: window.innerWidth },
      to: { x: inView2 ? window.innerWidth * 0.4 : window.innerWidth },
    });
    const left2right2 = useSpring({
      from: { x: 0 },
      to: { x: inView3 ? window.innerWidth * 0.1 : 0 },
    });

    return (
      <>
        <div>
          <animated.div
            ref={ref1}
            style={{
              width: '50vw',
              height: 80,
              background: '#ff6d6d',
              borderRadius: 8,
              ...left2right,
              alignContent: 'center',
              textAlign: 'center'
            }}
          >
            <h1>My Projects</h1>
          </animated.div>
        </div>

        <div
          style={{ marginTop: '10vh' }}
        >
          <animated.div
            ref={ref2}
            style={{
              width: '50vw',
              height: 80,
              background: '#ff6d6d',
              borderRadius: 8,
              ...right2left,
              alignContent: 'center',
              textAlign: 'center',
            }}
          >
            {MazeGameCard}
          </animated.div>
        </div>

        <div
          style={{ marginTop: '60vh' }}
        >
          <animated.div
            ref={ref3}
            style={{
              width: '50vw',
              height: 80,
              background: '#ff6d6d',
              borderRadius: 8,
              ...left2right2,
              alignContent: 'center',
              textAlign: 'center',
            }}
          >
            {DevOpsCard}
          </animated.div>
        </div>
      </>
  );
}

export default Projects;
